import logo from './logo.svg';
import './App.css';
import { Routes, Route, useNavigate, Navigate } from 'react-router-dom';
import { useState, useEffect } from 'react';
import FrontPage from './Pages/FrontPage';

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<FrontPage />} />
      </Routes>
    </>
  );
}

export default App;
